	return (
		<ThreeDots
			height="80"
			width="80"
			radius="9"
			color="#43372e"
			ariaLabel="three-dots-loading"
			wrapperStyle={{}}
			wrapperClassName=""
			visible={true}
		/>
	);
};

export default Loading;
